        console.log("Clicked");
    }
    
    return (
        <main>
            <div className="form">
                <input 
                     type="text"
                     placeholder="Top text"
                     className="form-input" />

                <input 
                type="text" 
                placeholder="Buttom text"
                className="form-input"/>
            

                <button className="form button"
                    onClick={getMemeImage}>Get a new Meme Image
                    </button>

            </div>
        </main> 
    )
}
